import React from "react";
import "./JoblyAppStyles.css"

const LoggedOut = () => {
  return (
    <div>
      <section className="section-container">
      <p className="title-container">
        You have been logged out. Thank you for visiting!
        </p>        
      </section>
    </div>
  );
};

export default LoggedOut;
